                    <p>Ex aeque tacimates conclusionemque pri, pri sumo populo utroque in. No vix commune scriptorem, populo inimicus cu est, ne omnes animal his. Meis zril verear ea qui. Quo solum interpretaris eu, an mel ridens erroribus. </p>
                    <p>Ex animal indoctum nam, imperdiet voluptatibus eu has. Eius accusata ea est. His at quis vitae diceret, his ridens phaedrum in.</p>

                    <button onClick={this.toggleDisplayBio}>Read Less</button>
                </div>
                ) : <div>
                    <button onClick={this.toggleDisplayBio}> Read more</button>
                </div>
        }

        <hr/>

        <Projects />

        <hr/>

